import { Routes, Route, Navigate } from "react-router-dom";


import Top from '../components/FootPlay'
import Content from '../components/FootPlay'
import Foot from '../components/FootPlay'
import FootPlay from '../components/FootPlay'
import Banner from '../components/FootPlay'



export default function MyRouter () {
  return (
    <Routes >
      <Route path="/" element={<FootPlay />} />
      {/* <Route path="/login" element={<Banner />} /> */}
      {/* router6的路由重定向写法 */}
      <Route path="/login" element={<Navigate to="/Banner" replace />} />
    </Routes >
  )
}
